import React, { Component } from "react";
import ToDoItem from "../toDoItem/toDoItem";
import "./style.css";

class Todo extends Component {
  constructor(props) {
    super(props);
    this.state = {
      todos: [{id:0, name:"play"},{id:1, name:"watch TV"},{id:2, name:"code"}],
    };
  }
  submitHandler = (e) =>{
    e.preventDefault();
    let inp = e.target.task.value;
    let newObj = {id:4, inp}
    this.state = {todos:[...this.state.todos, inp]}
    this.setState(this.state)
  }


  render() {
    return (
      <div className="todo">
        <form onSubmit={this.submitHandler}>
          <input type="text" name="task" />
          <button>Add Task</button>
        </form>
        <h1>To Do List:</h1>
        <ul>
          {this.state.todos.map((todo, i) => (
            <ToDoItem name={todo.name} key={i} />
          ))}
        </ul>

        {/* <ToDoItem /> */}
      </div>
    );
  }
}

export default Todo;
